import React from 'react'
import { Typography, Button, Container, makeStyles, TextField } from '@material-ui/core'
import ArrowForwardIosIcon from '@material-ui/icons/ArrowForwardIos';

const useStyle = makeStyles({
    btn: {
        background: 'violet',
        '&:hover':{
            background: 'blue'
        }
    },
    title:{
        textDecoration: 'underline',
        marginBottom: 10
    },
    field:{
        marginBottom: 20,
        marginTop: 20,
        display: 'block',
        width: '100%'
    }

})

function Notes(props) {
    const classes = useStyle()
    return (
        <Container>
            <Typography 
            className={classes.title}
            variant="h6"
            color='primary'
            >
                Hello Everyone
            </Typography>

            <form noValidate autoComplete='off'>
                <TextField 
                className = {classes.field}
                label="Note title"
                variant='outlined'
                color='secondary'
                required
                />
                <TextField 
                className = {classes.field}
                label="Note title"
                variant='outlined'
                color='secondary'
                multiline
                rows = {4}
                required
                />
            </form>

            <Button className = {classes.btn}
            variant="contained" 
            color="primary" 
            size="small"
            onClick={()=> console.log("oke")}
            endIcon={<ArrowForwardIosIcon/>}
            >Submit</Button>
        </Container>
    )
}

export default Notes
